import * as React from 'react';
import { LineChart } from '@mui/x-charts';

function Chart() {
    return (
        <div style={{ height: '300px', width: '100%' }}>
            <LineChart
                xAxis={[{ data: [1, 2, 3, 5, 8, 10] }]}
                series={[
                    {
                        data: [2, 5.5, 2, 8.5, 1.5, 5],
                    },
                ]}
            />
        </div>
    );
}

export default Chart;
